window.bookSummaryJSON = "<p>Fiona Hurston was too young when we first met.</p> <p>Too naive. Too innocent. Too tempting.</p> <p>I vowed to protect her, to keep her safe, and I have, for five long years. Even when keeping her safe meant keeping my distance. Even when the greatest threat to her innocence was me.</p> <p>But Fiona’s not a girl anymore.</p> <p>When danger’s at her door and we’re forced together, I won’t back down. I’ll defend her. I’ll shield her. I’ll comfort and keep her. Because Fiona Hurston is all grown up now. And it’s time she realized...she’s mine.</p>"; 
